import './Home.scss';
import Project from '../components/Project';
import Hero from '../components/Hero';
import { gsap } from 'gsap';
import { ScrollTrigger } from "gsap/ScrollTrigger";
import { useEffect } from 'react';
import SplitType from 'split-type';
import img from '../assets/projects/fireRacoon.png';


function Home() {

	useEffect(() => {
		//window.scrollTo(0, 0);

		gsap.to('.block', {
			opacity: 0,
			duration: 1.5,
			delay: 1,
			zIndex: -1
		});
	});

	window.addEventListener('load', function () {
		console.log('loaded');
		const myText1 = new SplitType('.line-popup', { types: 'lines', lineClass: 'clipy-line-popup clipy' });
		const myText2 = new SplitType('.clipy-line-popup ', { types: 'lines', lineClass: 'upsie' });

		var upsies = document.querySelectorAll('.upsie');
		var popup = document.querySelectorAll('.project-popup');

		gsap.registerPlugin(ScrollTrigger);

		upsies.forEach(upsie => {
			gsap.timeline({
				scrollTrigger: {
					trigger: upsie,
					start: 'bottom bottom',
					end: 'top bottom',
					scrub: true,
					markers: false
				}
			}).to(upsie, {
				y: 0,
				duration: .1
			});
		});

		popup.forEach(upsie => {
			gsap.timeline({
				scrollTrigger: {
					trigger: upsie,
					start: '-100% 97%',
					end: '-80% 97%',
					scrub: true,
					markers: false
				}
			}).to(upsie, {
				y: 0,
				stagger: 0.05,
				delay: 1,
				duration: 1
			});
		});
	});

	// headers for each section
	const header = (a, b) => {
		return (
			<div className='clipy'>
				<div className='upsie home-header'>
					<h2 className='header-number'>{a}</h2>
					<h2 className='header-title'>{b}</h2>
				</div>
			</div>
		);
	};

	const column2 = (title, text, skills) => {
		return (
			<div className='column-2'>
				<div>
					<h2 className='title line-popup'>{title}</h2>
					<div className='line-popup'>{text}</div>
				</div>
				<ul className='about-skills'>
					{skills.map(skill => <li className='line-popup'>{skill}</li>)}
				</ul>
			</div>
		);
	};

	return (
		<div className='Home'>

			<Hero className='home-section' />

			<div className='home-section'>
				{header('./1', 'about me')}
				<div id='home-about'>
					<p className='line-popup about-p'>A dedicated Software Engineering student @ CARLETON UNIVERSITY. constantly creating and learning. Merging creativity with technology to
						create functional and aesthetic systems.</p>
					<p className='line-popup about-p'>Outside of coding, you will find me drawing or crocheting something elaborate.</p>

					{column2('Skills', 'Over time, I\'ve cultivated this skill set, shaped by my academic pursuits at university and my personal passions. This is a small peek into my continuous learning journey.', ['Full-Stack Dev', 'UI/UX Design', 'Web Dev', 'Graphic Design'])}
					{column2('Technologies', 'Over time, I\'ve cultivated this skill set, shaped by my academic pursuits at university and my personal passions. This is a small peek into my continuous learning journey.', ['JS/HTML/CSS', 'ReactJS', 'Blazor', 'Python', 'Java', 'Figma'])}

				</div>
			</div>

			<div className='home-section' id='home-projects'>
				{header('./2', 'recent projects')}
				<Project img={img} title='ColorMe' />
				<Project img={img} title='cuHacking' />
				<Project img={img} title='ColorMe' />
			</div>

			<div id='home-projects'>
				{header('./3', 'contact me')}
			</div>
			<div className='space'></div>
		</div>
	);
}

export default Home;;
